import { useState, useEffect } from "react";

const TestApp = () => {
  const [aaa, setstate] = useState(false);

  useEffect(() => {
    console.log("aaa", aaa);
  }, []);

  const handle = () => {
    setstate(!aaa);
  };

  return (
    <div>
      <div onClick={() => handle}>click</div>
      <pre>{aaa}</pre>
    </div>
  );
};

export default TestApp;
